  // 1) 创建 Deck 实例
    const deckgl = new deck.DeckGL({
      container: 'deck-container',
      controller: true,
      initialViewState: jsonInput.initialViewState,
        getTooltip: info => {
      if (!info.object) return null;
      const o = info.object;
      return {
        html: `<div>
                 <b>OD对</b>：${o.od_pair || ''}<br/>
                 <b>流量合计</b>：${(o.flow_sum ?? 0).toFixed(1)}
               </div>`,
        style: { backgroundColor: 'rgba(0,0,0,0.7)', color: '#fff', padding: '4px' }
      };
    },
      mapStyle: "mapbox://styles/seukun/cl6he9nhp000e14mrrsiswa7c", // 加载底图
        mapboxApiAccessToken:"pk.eyJ1Ijoic2V1a3VuIiwiYSI6ImNrb212NGt4MDAwamkybnFvNXhlOXNoeDMifQ.GPxJSR5R1YEDpxPU38lmgA",
      layers: []
    });
    // ===== 2) 从 jsonInput 中取出图层数据 =====
  const geoDef   = (jsonInput.layers || []).find(l => l['@@type'] === 'GeoJsonLayer');
  const tripsDef = (jsonInput.layers || []).find(l => l['@@type'] === 'TripsLayer');

  const geoData   = geoDef   ? geoDef.data   : null;
  const tripsData = tripsDef ? tripsDef.data : [];

  // 计算整个数据的时间总长（最大时间戳）
  const loopLength = tripsData.reduce((mx, d) => {
    const ts = d.timestamps && d.timestamps.length
      ? d.timestamps
      : (d.path || []).map(p => p[2] || 0); // 兜底：从 path 第3列取时间
    const end = ts.length ? ts[ts.length - 1] : 0;
    return Math.max(mx, end);
  }, 0);


    // 2) 构建图层（加 tooltip）
    function buildLayers(currentTime) {
      return jsonInput.layers.map(layer => {
        if (layer['@@type'] === 'GeoJsonLayer') {
          return new deck.GeoJsonLayer({
            id: 'geo',
            data: layer.data,
            filled: layer.filled,
            stroked: layer.stroked,
            getFillColor: layer.getFillColor,
            getLineColor: layer.getLineColor,
            lineWidthMinPixels: layer.lineWidthMinPixels,
            pickable: false,
            getTooltip: info => {
              if (!info.object) return null;
              const p = info.object.properties || {};
              return {
                html: `<div>
                         <b>属性</b><br/>
                         ${Object.entries(p).slice(0,6).map(([k,v]) => `${k}: ${v}`).join('<br/>')}
                       </div>`,
                style: { backgroundColor: 'rgba(0,0,0,0.7)', color: '#fff', padding: '4px' }
              };
            }
          });
        }
        if (layer['@@type'] === 'TripsLayer') {
          return new deck.TripsLayer({
            id: 'trips',
            data: layer.data,
            getPath: d => d.path,
            getTimestamps: d => d.timestamps,
            getColor: d => d.color || [255,140,0],
            getWidth: d => (d.w_px||5)*4,
            opacity: 0.9,
            trailLength: 300,
            currentTime,
            pickable: true,

          });
        }
        return null;
      }).filter(Boolean);
    }

    // 3) 动画更新
    let t = 0;
      const speed = 0.5; // 调速：越大越快

      function animate() {
        t += speed;
        if (loopLength > 0 && t > loopLength) t = 0; // ✅ 循环
        deckgl.setProps({ layers: buildLayers(t) });
        requestAnimationFrame(animate);
      }

      deckgl.setProps({ layers: buildLayers(0) });
      requestAnimationFrame(animate);
  </script>
